import React from "react";
import { SideNavBar } from "./Navbar";
import ContactCard from "./ContactCard";

function MyContactCard({ currentUser }) {

    function handleMyInfoSubmit(e) {
        e.preventDefault();
        const nameInput = e.target.firstChild.nextSibling;
        const dobInput = nameInput.nextSibling.nextSibling;
        const pronounsInput = dobInput.nextSibling.nextSibling;
        const phone1NameInput = pronounsInput.nextSibling.nextSibling;
        const phone1NoInput = phone1NameInput.nextSibling.nextSibling;
        const phone2NameInput = phone1NoInput.nextSibling.nextSibling;
        const phone2NoInput = phone2NameInput.nextSibling.nextSibling;
        const phone3NameInput = phone2NoInput.nextSibling.nextSibling;
        const phone3NoInput = phone3NameInput.nextSibling.nextSibling;
        const phone4NameInput = phone3NoInput.nextSibling.nextSibling;
        const phone4NoInput = phone4NameInput.nextSibling.nextSibling;
        const email1NameInput = phone4NoInput.nextSibling.nextSibling;
        const email1Input = email1NameInput.nextSibling.nextSibling;
        const email2NameInput = email1Input.nextSibling.nextSibling;
        const email2Input = email2NameInput.nextSibling.nextSibling;
        const email3NameInput = email2Input.nextSibling.nextSibling;
        const email3Input = email3NameInput.nextSibling.nextSibling;
        const email4NameInput = email3Input.nextSibling.nextSibling;
        const email4Input = email4NameInput.nextSibling.nextSibling;
        const address1NameInput = email4Input.nextSibling.nextSibling;
        const address1Input = address1NameInput.nextSibling.nextSibling;
        const address2NameInput = address1Input.nextSibling.nextSibling;
        const address2Input = address2NameInput.nextSibling.nextSibling;
        const address3NameInput = address2Input.nextSibling.nextSibling;
        const address3Input = address3NameInput.nextSibling.nextSibling;
        const address4NameInput = address3Input.nextSibling.nextSibling;
        const address4Input = address4NameInput.nextSibling.nextSibling;
        const picUrlInput = address4Input.nextSibling.nextSibling;
        const notes1Input = picUrlInput.nextSibling.nextSibling;
        const notes2Input = notes1Input.nextSibling.nextSibling;
        const notes3Input = notes2Input.nextSibling.nextSibling;
        const notes4Input = notes3Input.nextSibling.nextSibling;
        const usernameInput = notes4Input.nextSibling.nextSibling;
        const passwordInput = usernameInput.nextSibling.nextSibling;



    }

    return (
        <div>
            <SideNavBar />
            <h1>My Contact Card</h1>
            <ContactCard user={currentUser} />
            <form id="mycontactform" onSubmit={handleMyInfoSubmit}>
                <label htmlFor="name">Name</label>
                <input type="text" name="name" defaultValue={currentUser.name}></input>
                <label htmlFor="dob">Birthday</label>
                <input type="date" name="dob" defaultValue={currentUser.dob}></input>
                <label htmlFor="pronouns">Pronouns</label>
                <input type="text" name="pronouns" defaultValue={currentUser.pronouns}></input>
                <label htmlFor="phone1name">Phone #1 Name</label>
                <input type="text" name="phone1name" defaultValue={currentUser.phone1name}></input>
                <label htmlFor="phone1no">Phone #1 Number</label>
                <input type="tel" name="phone1no" defaultValue={currentUser.phone1no}></input>
                 <label htmlFor="phone2name">Phone #2 Name</label>
                <input type="text" name="phone2name" defaultValue={currentUser.phone2name}></input>
                <label htmlFor="phone2no">Phone #2 Number</label>
